Let’s assume the following values are defined: $ cat modules/values.yaml: global: param1: 100 param2: "Yes" $ cat modules/01-some-module/values.yaml someModule: param1: "String" $ kubectl -n addon-operator get cm/addon-operator -o yaml data: global: | param1: 200 someModule: | param1: "Long string" param2: "FOO" The Addon-operator generates the following files with values: $ cat $CONFIG_VALUES_PATH {"global":{ "param1":200
}, "someModule":{ "param1":"Long string", "param2": "FOO"
}} $ cat $VALUES_PATH {"global":{ "param1":200, "param2": "YES"
}, "someModule":{ "param1":"Long string", "param2": "FOO"
}} A hook adds a new value with the help of a JSON patch: $ cat /modules/001-some-module/hooks/hook.sh #!/usr/bin/env bash
...
cat > $CONFIG_VALUES_JSON_PATCH_PATH <<EOF [{"op":"add", "path":"/someModule/param3", "value":"newValue"}]
EOF
... Now the ConfigMap/addon-operator has the following content: data: global: | param1: 200 someModule: | param1: "Long string" param2: "FOO" param3: "newValue" Next time the hook is executed, the Addon-operator would generate the following files with values: $ cat $CONFIG_VALUES_PATH {"global":{ "param1":200
},
"someModule":{ "param1":"Long string", "param2": "FOO", "param3": "newValue"
}} $ cat $VALUES_PATH {"global":{ "param1":200, "param2": "YES"
}, "someModule":{ "param1":"Long string", "param2": "FOO", "param3": "newValue"
}} Helm chart template replicas: {{ .Values.global.param1 }} would generate the string replicas: 200. As you can see, the value "100" from the values.yaml is replaced by "200" from the ConfigMap/addon-operator.
